// Step 1: Retrieve outputUrls and ensure it's handled safely
let outputUrls = items[0]?.json?.outputUrl || [];

// Step 2: Ensure outputUrls is parsed and always an array
if (typeof outputUrls === "string") {
    try {
        outputUrls = JSON.parse(outputUrls);
    } catch (error) {
        throw new Error("Failed to parse outputUrls: " + error.message);
    }
}

if (!Array.isArray(outputUrls)) {
    outputUrls = []; // Default to empty array if not valid
}

// Step 3: Generate the image blocks from outputUrls
const imageBlocks = outputUrls.map(url => ({
    type: "image_url",
    image_url: { url }
}));

// Step 4: Sanitize extracted text if imageBlocks is empty
let sanitizedText = "";
if (imageBlocks.length === 0) {
    const extractedText = items[0]?.json?.['Extracted Text'] || "";
    sanitizedText = extractedText
        .replace(/\n+/g, ' ')       // Normalize newlines into spaces
        .replace(/\\/g, '')         // Remove escape backslashes
        .replace(/"/g, '\\"')       // Escape double quotes
        .replace(/^\s+|\s+$/g, ''); // Trim leading/trailing whitespace
}


// Step 5: Return either imageBlocks or sanitized text
if (imageBlocks.length > 0) {
    return [{ json: { imageBlocks } }];
} else {
    return [{ json: { sanitizedText } }];
}
